    data: |
      SELECT - + col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 93 NOT IN ( - ( - + col1 ), 66, + 80, + - col1 - col2 );
  - name: tab2

outputs:
  - name: q12466.out
    data: |
      -51
      -67
      -77
